    return (
        <div>
            <label>
                Name:
                <input type="text" name="name" />
            </label> <br/>
            <button onClick={createParty(props.joinGame)}>Create Party</button> <br/>
            <button onClick={props.backClick}>Back</button>
        </div>
    );
}

export default CreateParty;
